style.css:
@-moz-document domain("roblox.com") {
/*/ Blue Home Background /*/
main#container-main, div#HomeContainer, .dark-theme .content {
  background-color: #394ac3;
}
  
/*/ White Text /*/
span, p, h1, h2, h3 {
  color: #ebebeb;
}
text-overflow xsmall text-label place-name ng-binding ng-scope {
  color: #ebebeb;
}
  
/*/ Black Divider Lines /*/
.home-interleave-divider {
	background-color: #232527;
}
  
/*/ Black Navigation Bar /*/
.dark-theme .rbx-header {
  background-color: #232527;
}
  
/*/ White Game Container Borders /*/
thumbnail-2d-container game-card-thumb-container {
  border: white 3px solid;
  border-radius: 12px;
}
}
